  let history = useHistory();
  return (
    <button type="button" onClick={() => history.goBack()}>
      2222
    </button>
  );
}
function router() {
  // let history = useHistory();
  return (
    <Router>
      <div>
        <Link to="/" onClick={BackButton}>
          首页
        </Link>{" "}
        <Link to="/list/">列表</Link>{" "}
        <Switch>
          {/* <button onClick={BackButton}>22</button> */}
          <Route>
            <List />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
export default router;
